import Header from './header';
import Footer from './footer';
import styles from '../screens/CSS/home.module.css';
import styleOrderUser from '../screens/CSS/orderUserItem.module.css'
import * as React from 'react';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import { Tabs, AppBar } from '@mui/material';
import { Typography } from '@mui/material';
import ProductInformation from './product';
import Card from '@mui/material/Card';
import CardMedia from '@mui/material/CardMedia';
import { CardActionArea } from '@mui/material';
import stylesProduct from '../screens/CSS/productInfor.module.css';
import imageTest from '../assets/testproduct.jpg'
import { Rating } from '@mui/material';
import { Link } from 'react-router-dom';
import ButtonChangeValue from './buttonChangeValue';
import UserRating from './userRating';


function OrderUserItem({status}){
    return(
        <div className={styleOrderUser.Home}>
            <div className={styleOrderUser.content} >
                <div className={styleOrderUser.wraper}>
                    <div className={styleOrderUser.tdisplay}>  
                        <Link to='/testShop' >
                            <h2>
                                Shop Mo Hinh
                            </h2>
                        </Link> 
                        <h5 className={styleOrderUser.statusTitle}> da giao </h5>
                    </div>
                    <div className={stylesProduct.productImage}>
                        <div className="image">
                            <Card sx={{ maxWidth: 80, minWidth: 80 }}>
                            <CardActionArea>
                                <CardMedia
                                component="img"
                                image={imageTest}
                                alt="green iguana"
                                />
                            </CardActionArea>
                            </Card>
                        </div>
                        <div className={styleOrderUser.productTitle}>
                            <h5> Rubik GAN Monster GO 2x2 / 3x3 / Pyraminx / Skewb Stickerless - Monster GO 3x3 M Có Nam Châm </h5>
                            <h5 className={styleOrderUser.item}> Loai hang: Rubix 3x3x3 </h5>
                            <h5 className={styleOrderUser.item}> So luong: 1 </h5>
                            <div className={stylesProduct.soldInfo}>
                                <button className={stylesProduct.button2} variant="light" onClick={() => console.log("them")}> Thêm vào giỏ hàng </button>
                                <button className={stylesProduct.button2}> Mua ngay </button>                    
                            </div>
                        </div>
                        <div>
                            30.00k
                        </div>
                        <div className={stylesProduct.footFake}>
                            <p>  </p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default OrderUserItem;
